package io.muhwyndhamhp.catnip.base

import io.muhwyndhamhp.catnip.local.dao.CatDao
import io.muhwyndhamhp.catnip.local.dao.UserDao
import io.muhwyndhamhp.catnip.model.Cat
import io.muhwyndhamhp.catnip.model.User
import javax.inject.Inject

class BaseRepository @Inject constructor(
    private val userDao: UserDao,
    private val catDao: CatDao
) {
    fun getUser() = userDao.getUser()

    fun insertUser(user: User) = userDao.insertUser(user)

    fun getCats() = catDao.getAllCat()

    fun prepopulateDatabase() {
        catDao.insertAllCat(
            listOf(
                Cat(
                    images = listOf(
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,"
                    ),
                    name = "Peaknose Cats"
                ),
                Cat(
                    images = listOf(
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,"
                    ),
                    name = "Spinx Cats"
                ),
                Cat(
                    images = listOf(
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,"
                    ),
                    name = "Persian Cats"
                ),
                Cat(
                    images = listOf(
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,"
                    ),
                    name = "Siamese Cat"
                )
            )
        )
    }
}